import Feed from "./Feed";
const Home = ({ posts }) => (
    <main className="Home">
        {posts.length ? (
            <Feed posts={posts} />
        ) : (
            <p style={{ marginTop: "2rem" }}>No Posts To Display</p>
        )}
    </main>
);
export default Home;
